function Menu(){
    return (
    <p>
    Menu:
    <center>
    <ul>
    <li><a href="/profile">Profile</a></li>
    <ul>
    <li><a href="/proyek/mobile-app">Galeri Produk</a></li>
    </ul>
    </ul>
    </center>
    </p>
    );
   }
   export default function WebApp(){
    return (
    <div>
    <h1>Pemesanan</h1>
    <p>Untuk pemesanan silahkan isi form dibawah ini</p>
    <hr />
    <Menu />
    </div>
    )
   }
